import React from 'react';
import bear from '../images/bear.png'
import { Link } from 'react-router-dom';
import '../App.css';




function Settings() {
    return(
        <div className="Bar">
          <img alt="logo" className="photo" src={bear}/>
          <h1 style = {{marginRight: "43%", paddingTop: "10px"}}>StudyBear</h1>
          <h3 className="barText">About us</h3>
          <h3 className="barText">How it works</h3>
          <h3 className="barText">Contact us</h3>
          <Link className="topButton" style={{textAlign: "center", lineHeight: "50px"}} to= '/logIn'> Join StudyBear!</Link>
        </div>
    );
}

export default Settings;
